import React, { useEffect, useRef } from 'react';
import * as d3 from "d3";

import './graph.css'


export const GraphView =() =>{
    const svgRef = useRef();

  useEffect(() => {
    const data = ['#4e79a7','#4e79a7','#4e79a7','#4e79a7'];

    const svg = d3.select(svgRef.current);

    svg
      .selectAll('circle')
      .data(data)
      .attr('fill', (d) => d)
  }, []);

  return <svg ref={svgRef}></svg>;
}
